    KossonGOLDEN001 = Kanon {"navel of life","the navel of life OM"}

    //Kanon 01
    KossonGOLDEN002 = Kanon {"Kanon  1.   1", "Im Namen der Schpfung, die da ist Liebe, Wissen, Weisheit, Wahrheit und (relative) Vollkommenheit."}
    KossonGOLDEN003 = Kanon {"Kanon  1.   2", "Preis (Ehre, Dank) sei ihr, der Schpfung aller Kreationen."}
    KossonGOLDEN004 = Kanon {"Kanon  1.   3", "Ihr allein lebet der Mensch, und ihr allein leben wir stetig."}
    KossonGOLDEN005 = Kanon {"Kanon  1.   4", "Ihre Gesetze und Gebote allein befolgen wir."}
    KossonGOLDEN006 = Kanon {"Kanon  1.   5", "Die Schpfung selbst fhret uns durch ihre Gesetze und Gebote zum Ziel der Evolution."}
    KossonGOLDEN007 = Kanon {"Kanon  1.   6", "Sie fhret uns auf dem Wege derer, die den Pfad der Wahrheit und Liebe beschreiten und die den Weg der Wahrheit schon vor uns beschritten und kein Missfallen erreget haben noch irregegangen sind."}
    KossonGOLDEN008 = Kanon {"Kanon  1.   7", "Im Namen der Schpfung, das ist unser Wille und unser Ziel der Evolution."}

    //Kanon 02
    KossonGOLDEN009 = Kanon {"Kanon  2.   1", "Im Namen der Schpfung, der Liebevollen, der Weisen."}
    KossonGOLDEN010 = Kanon {"Kanon  2.   2", "So sprichet der JHWH und der Prophet, die da sind Weisheitknig ber die irdischen Menschengeschlechter:"}
    KossonGOLDEN011 = Kanon {"Kanon  2.   3", "Der JHWH und der Prophet offenbaren die Gesetze und Gebote der Schpfung, die da ist die einzige Schpfung ihres Himmels (Universums)."}
    KossonGOLDEN012 = Kanon {"Kanon  2.   4", "Preis (Ehre) sei ihr, die da ist das Leben und das SEIN (Schpfungsleben)."}
    KossonGOLDEN013 = Kanon {"Kanon  2.   5", "Ihre siebenheitlichen Gesetzmssigkeiten offenkunden der JHWH und der Prophet, die da sind Mensch und kundige Offenbarung alles Wahrheit, aller Liebe, alle Weisheit und des Wissens und der Wege der Schpfung."}
    KossonGOLDEN014 = Kanon {"Kanon  2.   6", "Sie jedoch sind nicht eine Vertretung der Schpfung, sondern Erkenntnis, Offenbarung und Pflichterfllung der Wahrheit und Liebe in freier Form, zur Befolgung der Gesetze und Gebote der Schpfung."}
    KossonGOLDEN015 = Kanon {"Kanon  2.   7", "Und so sprichet der JHWH und der Prophet in Weisheit und freier Pflichterkennung und Pflichterfllung fr die Erfllung der Gesetze und Gebote der Schpfung:"}
    KossonGOLDEN016 = Kanon {"Kanon  2.   8", "Nicht ist verehrungswrdig (und anbetungswrdig) der JHWH, denn dies gebhret allein der Schpfung."}
    KossonGOLDEN017 = Kanon {"Kanon  2.   9", "Und nicht ist verehrungswrdig (vergtterungswrdig) und anbetungswrdig (ergebungswrdig) der Prophet, denn dies gebhret allein der Schpfung."}
    KossonGOLDEN018 = Kanon {"Kanon  2.  10", "Und nicht ist verehrungswrdig (vergtterungswrdig) und anbetungswrdig (ergebungswrdig) die Geistfhrer des Propheten, denn dies gebhret allein der Schpfung."}
    KossonGOLDEN019 = Kanon {"Kanon  2.  11", "Niemals verrichte ein Mensch sein Gebet (Anbettelung,Anflehung) and den JHWH oder an den Propheten oder an des Propheten Geistfhrer, denn Gebetsverrichtung (Insichgehen in Gedanken) gebhret allein an den Geist (Bewusstsein)."}
    KossonGOLDEN020 = Kanon {"Kanon  2.  12", "Niemals verehre ein Mensch den JHWH oder den Propheten oder des Propheten Geistfhrer, den Verehrung (Ehrwrdigung) gebhret allein der Schpfung."}
    KossonGOLDEN021 = Kanon {"Kanon  2.  13", "Verehrung und Anbetung gebhret allein der Schpfung, die da ist das Hchste und die (relativ) vollkommenste Vollkommenheit in ihrem Himmel(Universum)."}
    KossonGOLDEN022 = Kanon {"Kanon  2.  14", "Achtet, bet und bringet jedoch Respekt und Ehrfurcht (Ehrung, Ehrwrdigung, Ehrerbietung, Ehrwrdigkeit) entgegen allem Leben, so auch dem JHWH der irdischen Menschengeschlechter und auch dem Propheten und des Propheten Geistfhrer."}
    KossonGOLDEN023 = Kanon {"Kanon  2.  15", "Achtet, bet und bringet jedoch Respekt und Ehrfurcht (Ehrung, Ehrerbietung, Ehrwrdigung, Ehrwrdigkeit) entgegen allem Leben."}
    KossonGOLDEN024 = Kanon {"Kanon  2.  16", "Achtet, bet und bringet jedoch Respekt und Ehrfurcht (Ehrung, Ehrerbietung, Ehrwrdigung, Ehrwrdigkeit) entgegen dem JHWH, der da ist der Weisheitsknig der Menschengeschlechter dreier Welten."}
    KossonGOLDEN025 = Kanon {"Kanon  2.  17", "Achtet, bet und bringet jedoch Respekt und Ehrfurcht (Ehrung, Ehrerbietung, Ehrwrdigung, Ehrwrdigkeit) entgegen dem Propheten, der da ist wahrlicher Prophet fr die irsichen Menschengeschlechter in Wahrheit, Liebe, Weisheit und Wissen."}
    KossonGOLDEN026 = Kanon {"Kanon  2.  18", "Achtet, bet und bringet jedoch Respekt und Ehrfurcht (Ehrung, Ehrerbietung, Ehrwrdigung, Ehrwrdigkeit) entgegen dem Propheten, der da ist Mittler, Knder, Wissender und Liebevoller und Weiser zwischen den zu belehrenden irdischen Menschengeschlechter und der Lehre der Wahrheit."}
    KossonGOLDEN027 = Kanon {"Kanon  2.  19", "Achtet, bet und bringet jedoch Respekt und Ehrfurcht (Ehrung, Ehrerbietung, Ehrwrdigung, Ehrwrdigkeit) entgegen den Geistfhrern des Propheten, die da sind die Wissenden und Belehrer der unwissenden irdischen Menschengeschlechter im Auftrage des Propheten."}
    KossonGOLDEN028 = Kanon {"Kanon  2.  20", "Befolget die Lehre der Gesetze und Gebote der Schpfung, denn allein ihre Befolgung gewhret das wahrliche Leben und die Evolution zum SEIN (Schpfungsleben)."}
    KossonGOLDEN029 = Kanon {"Kanon  2.  21", "In Namen der Schpfung, der Liebevollen, der Weisen."}

    //Kanon 03
    KossonGOLDEN030 = Kanon {"Kanon  3.   1", "Im Namen der Schpfung, der Wissenden, der Kreierenden."}
    KossonGOLDEN031 = Kanon {"Kanon  3.   2", "So sprichet der JHWH, der da ist der JHWH der irdischen Menschengeschlechter:"}
    KossonGOLDEN032 = Kanon {"Kanon  3.   3", "Das ist das Buch der Gesetze und Gebote der Schpfung, ausgelegt und erklret mit verstndlichem Wort."}
