    KossonSILVER0053 = Kanon {"Kanon  8.   4", "Am Anfang war die Eiform der Schpfungsspirale, hervorgebracht durch die ldee der Urschpfung."}
    KossonSILVER0054 = Kanon {"Kanon  8.   5", "Die Schpfungsspirale war geistige Urform, winzig klein und nur von der Grsse eines Flohs."}
