    KossonCOPPER1343 = Kanon {"Kanon 31. 608", "Es sei der Mensch im Essen und im Tranke auch gemssiget, so er sich nicht hingebe an Frass und Vllerei, dergleichen aber, wird es doch getan, kommet gleich dem Verflschen von Essbarem, also beides fallet in Unverstand und Schwachheit und also im schwaches Sinnen und Bldheit, denn beides fhret zu Krankheit und bel im Krper und im Denken und Fhlen, gleichsam wenn da vom Menschen Essbares vom Getier geraubet und gegessen wird, weshalben viele Menschein leiden an mannigfachen Krankheiten und an schwachem und langsamem Denken und an Schwachheit aller Art."}
